'use strict'

function xcase (c, d) {
  if (c === d) {
    return false
  }
  return c.toLowerCase() === d.toLowerCase()
}

function react (inp) {
  let found
  do {
    found = false
    for (let i = 0; i < inp.length; i++) {
      if ((i > 0) && xcase(inp[i - 1], inp[i])) {
        inp = inp.slice(0, i - 1) + inp.slice(i + 1)
        found = true
        break
      }
    }
  } while (found)
  return inp
}
module.exports = (inp) => {
  let min = Infinity
  for (let i = 'a'.charCodeAt(0); i <= 'z'.charCodeAt(0); i++) {
    const l = inp.replace(new RegExp(String.fromCharCode(i), 'gi'), '')
    const rl = react(l)
    if (rl.length < min) {
      min = rl.length
    }
  }
  // return react(inp).length
  return min
}
